import React from 'react';

function Result() {
  const totalScore = window.history.state.totalScore; // 총 점수 가져오기

  return (
    <div>
      <h1>결과</h1>
      <div> 총 점수 : {totalScore} </div>
    </div>
  );
}

export default Result;
